// DeleteUniqueIndexCache 删除索引存在的缓存
func (c *ConfigDatumRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.ConfigDatum) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, c.cache.Key(CacheConfigDatumByConditionPrefix))
	keys = append(keys, c.cache.Key(CacheConfigDatumUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[c.cache.Key(CacheConfigDatumByIDPrefix, item.ID)] = struct{}{}
			KeyMap[c.cache.Key(CacheConfigDatumUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[c.cache.Key(CacheConfigDatumByKeyPrefix, item.Key)] = struct{}{}
			KeyMap[c.cache.Key(CacheConfigDatumUnscopedByKeyPrefix, item.Key)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := c.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
